async def aiodownload(url, name):
    async with aiohttp.ClientSession() as session:
        async with session.get(url) as resp:
            async with aiofiles.open(f'./华语金曲千禧年前的旋律/{name}.mp3', mode='wb') as f:
                await f.write(await resp.content.read())


async def main():
    for i in range(len(urls)):
        urls[i] = urls[i].split(".mp3")[0]+'.mp3'
    await asyncio.wait(list(map(lambda x: asyncio.create_task(aiodownload(x, x.rsplit('/', 1)[1].replace('.mp3', ''))), urls)))


if __name__ == '__main__':
    t1 = time.time()
    loop = asyncio.get_event_loop()
    loop.run_until_complete(main())
    print(time.time() - t1)
